import React from "react";

const Data = (props) => {
  const { totalSaleAmount, totalSoldItems, totalNotSoldItems } = props;
  return (
    <div className="Data">
      <h4>
        <span>Total Sale Amount: {totalSaleAmount}</span>
        <span>Total Sold Items: {totalSoldItems}</span>
        <span>Total Not Sold Items: {totalNotSoldItems}</span>
      </h4>
    </div>
  );
};

export default Data;
